import React from 'react';
import './style.css';
/** 
*@author
*@function Header
**/

const Header = (props) =>{
    return(
        <header className="headerMenu">
        <nav className="headerMenu  ">
            <a>Home</a>
            <a>About Us</a>
            <a>Contact Us</a>
        </nav>
        <div className="headerMenu">
            Social Media links 
        </div>
            
        </header>
    );
}
export default Header;
